import React from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';

//scrollspy
import Scrollspy from 'react-scrollspy'

const styles = theme => ({
  root: {
    /*top: 78,
    position: 'sticky',*/
    padding: 10,
    justifyContent: 'stretch',
    justifyItems: 'stretch',
    display: 'flex',
  },
  flexBox: {
    display: 'flex',
  },
  buttonMonth: {
    padding: 5,
    color: '#000',
    flexGrow: 1,
    flexShrink: 1,
    justifyContent: 'stretch',
  },
});

/*const styles = {
  appBar: {
    top: 78,
    position: 'fixed',
    zIndex: 1,
    width: '100%',
  },
};*/

function MonthBar(props) {
  const { classes } = props;

  return (
        <div className={classes.root}>
              <Scrollspy className={classes.flexBox} style={{paddingLeft: 1}} items={['section-1', 'section-2', 'section-3', 'section-4', 'section-5', 'section-6','section-7', 'section-8', 'section-9', 'section-10', 'section-11', 'section-12']} currentClassName="is-current" componentTag="div">                
                <a className={classes.buttonMonth} href="#section-1">jan</a>
                <a className={classes.buttonMonth} href="#section-2">feb</a>
                <a className={classes.buttonMonth} href="#section-3">mrt</a>
                <a className={classes.buttonMonth} href="#section-4">apr</a>
                <a className={classes.buttonMonth} href="#section-5">mei</a>
                <a className={classes.buttonMonth} href="#section-6">jun</a><br />
                <a className={classes.buttonMonth} href="#section-7">jul</a>
                <a className={classes.buttonMonth} href="#section-8">aug</a>
                <a className={classes.buttonMonth} href="#section-9">sep</a>
                <a className={classes.buttonMonth} href="#section-10">okt</a>
                <a className={classes.buttonMonth} href="#section-11">nov</a>
                <a className={classes.buttonMonth} href="#section-12">dec</a>
              </Scrollspy>
        </div>    
  );
}

MonthBar.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(MonthBar);
